angular.module("cosmetApp",["ngRoute"]);function config(e,r){e.when("/",{templateUrl:"home/home.view.html",controller:"homeCtrl",controllerAs:"vm"}).when("/prices",{templateUrl:"prices/prices.view.html",controller:"pricesCtrl",controllerAs:"vm"}).otherwise({redirectTo:"/"});r.html5Mode(true)}angular.module("cosmetApp").config(["$routeProvider","$locationProvider",config]);angular.module("cosmetApp").controller("homeCtrl",homeCtrl);function homeCtrl(){var e=this;e.pageHeader={title:"cosmetApp"}}angular.module("cosmetApp").controller("pricesCtrl",pricesCtrl);function pricesCtrl(){var e=this;e.pageHeader={title:"cosmetApp"}}